import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    margin-top: 40px;

    background-color: #f605;
    width:100%;
    height:60px;
    display: flex;
    justify-content: center;
    align-items: center;
    padding:0 40px;

    .navContainer{
      width:100%;
      background-color: #00f5;
      display: flex;
      margin:0 auto;

      .navInner{
        width:1600px;
        display: flex;
        align-items: center;
        justify-content: space-between;

        .navWrap{
          display: flex;
          align-items: center;

          .logoImg{
            width:140px;
            height:auto;
            margin-right:40px;
          }
        }

        .iconWrap{
          ul{
            display: flex;
            align-items: center;

            li{
              margin-left:20px;

              &:first-child{
                margin-left:0;
              }
            }
          }
          
        }
      }
    }
`;

const Header = memo(() => {

  const {nav} = dataset.header;

  return (
    <HeaderContainer>
      <nav className='navContainer'>
        <div className='navInner'>
          <div className='navWrap'>
            <img className='logoImg' alt='logoImg' src='img/logo.png'/>
              <ul className='navWrap'>
                {nav.map((v, i) =>{
                  return(
                    <li key={i}>{v.title}</li>
                  )
                })}
              </ul>
          </div>
          <div className='iconWrap'>
            <ul>
              <li><a href='#'><img alt='user' src='img/icon/top_user.png' /></a></li>
              <li><a href='#'><img alt='search' src='img/icon/top_search.png' /></a></li>
              <li><a href='#'><img alt='wish' src='img/icon/top_wish.png' /></a></li>
              <li><a href='#'><img alt='cart' src='img/icon/top_cart.png' /></a></li>
            </ul>
          </div>
        </div>
      </nav>
    </HeaderContainer>
  );
});

export default Header;
